import { useParams } from "react-router-dom";
import { useVideos } from "../../../context/videos-context";
import { VideoCard } from "../../card/video-card";

const SearchResult = () => {
  const { searchTerm } = useParams();
  const { videoState } = useVideos();
  const searchedVideos = videoState.videos
    .filter(({ title }) =>
      title.toLowerCase().includes(searchVideo.toLocaleLowerCase())
    )
    .map((item) => <VideoCard videoData={item} />);
  return (
    <>
      <div className="title">{`Search results for ${searchTerm} `}</div>
      <div className="">{searchedVideos}</div>
    </>
  );
};

export { SearchResult };
